var lnGalery=[{img:__WEBPACK_IMPORTED_MODULE_1__CIMG3_4_jpg___default.a,titre:"L'aéronautique ",answers:[{point:0,type:"finie",content:"L'aéronautique comporte les sciences et les techniques ayant pour but de construire et de faire évoluer un aéronef"+"dans l'atmosphère terrestre. "+"Les sciences aéronautiques comprennent en particulier l'aérodynamique, une branche de la mécanique des fluides , "+"les techniques sont celles qui concernent la construction des aéronefs, leur propulsion ainsi que les servitudes."+"la Cigogne Blanche vient de l' As des As français René Fonck,le 1er ou 2e As Mondial, selon le système d'homologation de victoire aérienne. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_0__CIMG3_2_jpg___default.a,titre:"Une invasion chinoise ",answers:[{point:0,type:"finie",content:"Le Fouga est présent dans le film Les Chinois à Paris"+"Pendant que le président de la République française rassure son pays sur la force que celui-ci opposera "+"à une invasion chinoise avant de s'embarquer avec son entourage dans un avion pour New York, l'armée d'occupation chinoise "+"se met en place sans effusion de sang, et entreprend de réformer la France à sa façon. Le général Pou-Yen installe "+"son quartier général aux Galeries Lafayette, et depuis Pékin le Comité central nomme le Français Hervé Sainfous de Montaubert "+"au poste de gouverneur de la France occupée. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_5__CIMG3_3_jpg___default.a,titre:"PAF ",answers:[{point:2,type:"finie",content:"La Patrouille de France (PAF pour Patrouille acrobatique de France) est la patrouille acrobatique officielle"+"de l'Armée de l'air française créée en 1953. Avec les autres ambassadeurs de l'Armée de l'Air, sa mission est de représenter"+"cette arme, et d'être l'ambassadrice de l'aéronautique française à l'étranger. "+"Stationnée sur la base aérienne 701 de Salon-de-Provence, elle est considérée comme l'une des meilleures formations acrobatiques. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_3__CIMG3_11_jpg___default.a,titre:"Des terrains d'aviation ",answers:[{point:0,type:"finie",content:"Des petits avions ont été beaucoup utilisés par les scientifiques et auteurs de films animaliers pour "+"atteindre des milieux naturels éloignés, pour photographier, filmer, surveiller l'environnement, pour surveiller d'éventuels "+"départs de feu, pour compter des populations d'espèces menacées (éléphants, oiseaux posés en mer, lutter contre le braconnage."+"On reproche cependant aux vols de loisir et baptêmes de l'air (souvent à proximité de zones urbaines) d'être source "+"de nuisance sonore et de pollution de l'air ou des terrains d'aviation. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_4__CIMG3_5_jpg___default.a,titre:"Désir immémorial",answers:[{point:0,type:"finie",content:"En 1783, les frères Montgolfier grâce au ballon à air chaud et Jacques Charles grâce au ballon à gaz "+"permettent à l'être humain de s'élever dans l'atmosphère mais sans contrôle de la trajectoire. La solution viendra "+"de l'étude d'un jouet, le cerf-volant, connu en Orient depuis l'Antiquité mais qui ne sera introduit en Europe "+"qu'au XIIIe siècle."+"L'aviation est née du désir immémorial des hommes de voler, comme en témoignent la légende d'Icare "+"ou la machine volante de Léonard de Vinci, vers 1500. Il a toutefois fallu attendre la fin du XVIIIe siècle "+"pour que des hommes s’élancent à la conquête du ciel, grâce au développement de l'aérostation et aux premières "+"tentatives de vol plané. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_2__CIMG3_6_jpg___default.a,titre:"Chance Vought F4U Corsair ",answers:[{point:0,type:"finie",content:"Le Chance Vought F4U Corsair est un avion militaire américain, utilisé lors de la Seconde Guerre mondiale et jusqu'en 1968."+"Il est l'un des appareils les plus connus , notamment grâce à la série télévisée Les Têtes brûlées,"+"laquelle a popularisé sa silhouette trapue et son aile en W qui rendent le Corsair presque immédiatement reconnaissable."+"Il s'illustra essentiellement dans le Pacifique, servant à la fois au sein de l'US Navy et de l'US Marine Corps."+"Vitesse maximum: 717,77 km/h, Vol inaugural: 29 mai 1940, Longueur: 10,26 m, Envergure: 12,50 m,"+"Date de retrait: 1953, Date d’introduction: 28 déc. 1942"+"Personnage : Gregory Boyington, Jesse L. Brown, Kenneth A. Walsh. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_6__CIMG3_7_jpg___default.a,titre:"Engin volant ",answers:[{point:0,type:"finie",content:"Le premier être humain ayant déclaré avoir volé à l'aide d'un moteur est le Français Clément Ader, "+"aux commandes de son Avion. La réalité de ces vols est discutée, à cause du manque de témoins et par l'absence "+"de contrôle en vol de ses engins."+"La première tentative a lieu en 1890 aux commandes de l'Éole ; les marques laissées par les roues dans le sol meuble "+"auraient présenté un endroit où elles étaient moins marquées et auraient totalement disparu sur une vingtaine ou "+"une cinquantaine de mètres. Son engin volant aurait ainsi effectué un bond ; il n'y avait pas de témoins autres "+"que des employés d'Ader. La même machine, essayée devant des témoins officiels en 1891, ne donne pas d'autres résultats. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_7__CIMG3_8_jpg___default.a,titre:"« art sur le nez (des avions) »",answers:[{point:2,type:"finie",content:"Le Nose art, est constitué de « peintures de guerre » "+"sur les avions militaires. Elles sont apparues lors de la Première Guerre mondiale mais ont connu leur apogée pendant "+"la Seconde Guerre mondiale. "+"Elles n'étaient pas encouragées par l'état-major mais tolérées car elles permettaient de maintenir le moral des troupes."+"Les hommes cherchaient le meilleur lors de jeux nom ou motif pour leurs avions."+"Ces motifs étaient peints par l'équipage ou par un artiste officieusement reconnu par la hiérarchie militaire du fait "+"de son talent et qui se retrouvait donc affecté officiellement aux cuisines mais qui ne passait que peu de temps aux casseroles."+"Les avions allemands de la Luftwaffe ont parfois mis en œuvre du « Nose Art », notamment Mickey Mouse pour la Légion Condor "+"envoyée en Espagne en 1936 pour soutenir Franco ou sur les avions de l'as allemand Adolf Galland. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_8__CIMG3_9_jpg___default.a,titre:"Heinkel He ",answers:[{point:0,type:"finie",content:"L'entreprise Heinkel s'installa à Warnemünde en 1922 alors que les restrictions imposées par le traité de Versailles "+"sur l'aviation allemande se relâchaient. Le premier grand succès de la compagnie fut le Heinkel He 70, un avion de transport "+"de courrier rapide conçu pour la Deutsche Luft Hansa en 1932. L'avion battit un grand nombre de records de vitesse pour sa classe "+"et fut suivi du Heinkel He 111.Après la guerre, Heinkel n'avait plus le droit de construire des avions et la compagnie se mit "+"à fabriquer des bicyclettes, "+"des vélomoteurs et des Mobylettes. La compagnie reprit la fabrication d'avions vers le milieu des années 1950 en construisant "+"sous licence le F-104 Starfighter pour la Luftwaffe de l'Allemagne de l'Ouest. "+"Dans le jeu vidéo de stratégie Empire Earth : durant l'ère atomique - Seconde guerre mondiale (époque 11), "+"il est possible de produire des Bombardiers Heinkel dans les aéroports. Il est l'amélioration du Bombardier Gotha. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_9__CIMG3_10_jpg___default.a,titre:"Boeing-Stearman Model 75 ",answers:[{point:0,type:"finie",content:"Le Boeing-Stearman Model 75 est un biplan utilisé comme avion d'entraînement militaire. Au moins 9 783 modèles ont été construits "+"aux États-Unis par le fabricant Boeing et Stearman durant les années 1930 et 19401. Stearman Aircraft (en) devient une filiale "+"de Boeing en 1934. Connu sous les noms de Stearman, Boeing Stearman ou Kaydet, il sert de formateur principal pour "+"l'United States Army Air Forces (USAAF), pour l'entrainement de base dans la United States Navy (USN) (comme le NS et N2S) "+"et dans l'Aviation royale canadienne (RCAF) sous le nom de Kaydet durant la Seconde Guerre mondiale. Après la fin du conflit,"+"des milliers d'avion en surplus sont vendus sur le marché civil. Juste après la guerre, ils ont été utilisés couramment "+"comme avion de loisir et pour le travail agricole."+"Puissance unitaire :220 ch, Envergure : 9,81 m, Longueur7,54 m , Hauteur2,95 m "+"Surface alaire 27,7 m2. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_3__CIMG3_11_jpg___default.a,titre:"Le statut d'as ",answers:[{point:0,type:"finie",content:"Au cours de sa formation, un pilote de voltige passe un « premier cycle », puis un « deuxième cycle »."+"Le premier cycle (ou voltige positive) permet de réaliser des figures de base sous facteurs de charges positifs "+"à l'exception des virages dos. Les figures de bases sont décrites au paragraphe suivant. Le deuxième cycle "+"(ou voltige avancée et négative) permet de réaliser toutes les figures complexes et sous accélérations négatives répertoriées."+"Il débouche naturellement vers le haut niveau où les meilleurs pilotes créent eux-mêmes des figures de plus en plus complexes "+"et spectaculaires."+"Le statut d'as s'obtient en principe au bout de cinq victoires en combat aérien et ce en référence au nombre de signes "+"sur la carte à jouer « As ». Mais ce comptage ne prend pas en compte les victoires « probables »"+"(la victoire n'a pas été confirmée par d'autres observateurs que le pilote), ou bien les enregistre comme une demi-victoire. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_10__CIMG3_12_jpg___default.a,titre:"Une activité aérienne ",answers:[{point:0,type:"finie",content:"Les premiers modèles d'avions qui prirent l'air, tels le Wright Flyer, le Santos-Dumont 14-bis ou l'hydravion <Le Canard>"+"d'Henri Fabre (1910), ne possédaient pas le type d'empennage arrière qui s'est imposé plus tard et que l'on dit maintenant "+"« conventionnel ». "+"La voltige aérienne est une activité aérienne consistant à utiliser un aéronef pour effectuer des figures de voltige, "+"c'est-à-dire des manœuvres aériennes sortant de l'ordinaire. Les figures de voltiges peuvent être réalisées par des avions"+"ou des planeurs pour le loisir, l’entrainement ou la compétition. Certains hélicoptères sont capables d'exécuter des figures"+"comme les boucles ou les tonneaux. La voltige se pratique également à plusieurs aéronefs, de nombreuses patrouilles acrobatiques "+"civiles et militaires existent dans différents pays. ©Wiky"}]},{img:__WEBPACK_IMPORTED_MODULE_11__CIMG3_13_jpg___default.a,titre:"Combinaison de manœuvres",answers:[{point:2,type:"finie",content:"Les différentes figures de voltiges se composent d'une combinaison de manœuvres élémentaires se succédant : "+"boucle, tonneau, vrille, immelmann ou rétablissement normal, retournement ou demi huit cubain, "+"renversement, déclenché, virage dos, chandelle, nœud de Savoie ou huit cubain."+"inconnus seront notés par des juges sur la qualité de la réalisation et la conformité avec les figures prévues "+"Les figures de voltige sont codifiées selon une norme dite « Catalogue Aresti » du nom de son créateur, un aviateur espagnol. ©Wiky"}]}];/* harmony default export */ __webpack_exports__["a"] = (lnGalery);

